def δ (x : ℕ) : ℕ :=
  if h : 0 < x then
    let divisors := {d ∈ Finset.range (x + 1) | d > 0 ∧ d % 2 = 1 ∧ d ∣ x}
    in if divisors.Nonempty then divisors.max' (Finset.max'_lt_of_mem divisors h) else 1
